Frank.  My computer just won&#39;t open these clips.  Very frustrating for me.
I know it&#39;s a pain in the arse to load them in the files section instead of
just adding as an attachment but maybe that might help?  Then again if it is
just me with the problem then no worries.  I love computers and hate them at
the same time!!  

k



  _____  


From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
Frank Sumption
Sent: Tuesday, April 07, 2009 9:45 AM
To: grassharp@yahoogroups.com; evp-itc@yahoogroups.com
Subject: [EVP-ITC] Some more from last month.

 I rarely know if anyone hears this stuff, as few comment. The one about
sausage is kinda iffy.&quot;Princess, I never Liked that box...&quot; is the same on
as &quot;Princess I love that box...&quot;, I just hear it different this morning.
That&#39;s the only one I hear different from last night. I included the
forward, and reverse components. 

 These are from the test I did to see if I could use a pre-recorded RAW
audio tape in areas wherer there&#39;s no radio stations, sincve many insist on
going to &quot;haunted locations&quot; that have few, if any radio stations to use for
the raw audio. #48 has an aux input so other raw audio can be used.

 Frank-S



